Text:
@mkeleshe: Bra du er fornøyd :) Jeg aktiverte med 7Loader og alt ser bra ut så langt.
(http://thepiratebay.org/torrent/5050230/Windows_7_RTM_Build_7600_Activator__1.4_-_MaMuNi.rar)

@Gega: Den versjonen du kan laste ned hos Microsoft er RC1 (Build 7100), en uferdig versjon. Dette er RTM (Build 7600) versjonen, den ferdige utgaven som blir lansert 22. oktober. Når du aktiverer den har den ingen utløpsdato i motsetning til Beta/RC1 utgavene.
